// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import CreateClientForm from './components//CreateClientForm';
import AtendimentosList from './components/atendimentos/AtendimentosList';
// import AtendimentoPage from './components/AtendimentoPage'; // Assumindo que você tem uma página de atendimentos

const App = () => {
  return (
    
    <Router>
      <Routes>
        
        <Route path="/criar-cliente" element={<CreateClientForm />} />
        
        { <Route path="/atendimento" element={<AtendimentosList />} /> }
       
      </Routes>
    </Router>
  );
};

export default App;
